import React from "react";

function Input({
  type,
  className,
  placeholder,
  maxLength,
  onChange,
  children,
  id,
  value,
}) {
  return (
    <>
      <input
        type={type}
        className={className}
        placeholder={placeholder}
        id={id}
        minLength="2"
        maxLength={maxLength}
        required
        onChange={onChange}
        value={value}
        name={id}
        autoComplete="current-password"
      />
      {children}
    </>
  );
}

export default Input;
